const MAP_TILE_DIRECTORY = "http://localhost:9000/RoverMap/{z}/{x}/{y}.png";
const MAP_CENTER = { lat: 51.077208, lng: -114.145478 };

export const launchConsts = {
  mapTileDirectory: MAP_TILE_DIRECTORY,
  mapCenter: MAP_CENTER,
};
